import React from 'react';
import {ListGroup} from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
    item: {
        width: 1000px;
    }
`;
export const Home = () => (
    <div>
        <Styles>
            <ListGroup horizontal>
                <ListGroup.Item className="list">PLĂȚI SECURIZATE</ListGroup.Item>
                <ListGroup.Item className="list">LIVRARE ÎN 3 ORE</ListGroup.Item>
                <ListGroup.Item className="list">100% DISCREȚIE ȘI GARANȚIE</ListGroup.Item>
                <ListGroup.Item className="list">FELICITARE CADOU</ListGroup.Item>
            </ListGroup>
        </Styles>
    </div>
)
